import styled from "styled-components";

import Link from "next/link";

const SidebarWrapper = styled.div`
	background: #181818 !important;
	width: 90px;
	height: 100%;
	position: absolute;
	top: 0;
	z-index: 3;
	min-height: 500px;
`;

const Sidebar = () => (
	<SidebarWrapper>
		<h1>hello</h1>
	</SidebarWrapper>
);

export default Sidebar;
